import React from "react";
import {useForm} from "react-hook-form";


function IngredientNew() {

    const [register, handleSubmit, errors] = useForm();

    const onSubmit = (event) => {
        event.preventDefault();
    };

    return (
        <form className={"form-ingredient"} onSubmit={handleSubmit(onSubmit)}>
            <label htmlFor={"ingredient"}>Ingredient</label>
            <input className={"form-control"} name={"ingredient"}
                   type={"text"} placeholder={"Please add an ingredient"}
                   ref={register()}
            />
        </form>
    )
}

export default IngredientNew;
